import React from "react";

function Card(props) {
  return (
    <div className="test">
      <input type="checkbox" />
      <h4>{"12-03-2022"}</h4>
      <p>{props.value.note}</p>
      <img src="edit.jpeg" alt="edit" className="edit" />
      <img src="delete.png" alt="delete" className="delete" />
    </div>
  );
}

export default Card;
